description:
The 80's lost their innocence but not their sense of humor! The domestic goddess is preparing for a nice family meal when she is confronted by the horrible fact that everyone around her is having sex. Darlene and David, Becky and some random ... Full Descriptionjock, and even her bouncy boy is coming into his manhood with his college professor. Roseanne is just trying to digest her food but can't help getting caught up in the carnal pleasures that seem to surround the Conner household. Find out what happens when one of America's funniest family takes off the gloves and the clothes.


